SET SQL_MODE="NO_AUTO_VALUE_ON_ZERO";
SET time_zone="+00:00";

CREATE TABLE public.municipality (
    mun_id int(11) NOT NULL,
    dept_id varchar(3) NOT NULL,
    mun_name varchar(50) NOT NULL,
    mun_code varchar(5) NOT NULL,
    insee_code varchar(5),
    gps_lat double precision,
    gps_lng double precision
);

ALTER TABLE public.municipality
    ADD CONSTRAINT pk_municipality PRIMARY KEY (mun_id);

